/*Table structure for table `facturas` */

DROP TABLE IF EXISTS `facturas`;

CREATE TABLE `facturas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cliente_id` int(11) NOT NULL,
  `status_id` int(11) NOT NULL DEFAULT 1,
  `numero_factura` varchar(255) NOT NULL,
  `importe` varchar(30) NOT NULL,
  `fecha_facturacion` date DEFAULT NULL,
  `fecha_promesa_pago` date DEFAULT NULL,
  `comentarios_adicionales` text DEFAULT NULL,
  `pagada` int(11) DEFAULT 0 COMMENT '0 => No, 1 => Si',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `cliente_id` (`cliente_id`),
  KEY `status_id` (`status_id`),
  CONSTRAINT `facturas_ibfk_1` FOREIGN KEY (`cliente_id`) REFERENCES `clientes` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `facturas_ibfk_2` FOREIGN KEY (`status_id`) REFERENCES `status` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=599 DEFAULT CHARSET=utf8mb4;

